import React from 'react'
import Typed from 'react-typed'

function Home() {
    return (
        <div>
            <h1>What Am I?</h1>
        <Typed
        strings={[
            ' ',
            'Front-End Developer',
            'Back-End Developer',
            'Blockchain Enthusiast',
            'MERN Stack',
            ' ',
            ' ']}
            typeSpeed={40}
            backSpeed={50}
            loop>
        </Typed>
        </div>
    )
}

export default Home
